import { Routes, Route, Link } from "react-router-dom";
import CarLeaseQuiz from './components/CarLeaseQuiz';
import CarLeaseResults from './components/CarLeaseResults';

function Home() {
  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 to-indigo-100 flex items-center justify-center p-4">
      <div className="bg-white rounded-xl shadow-xl p-8 text-center">
        <h1 className="text-3xl font-bold text-gray-900 mb-4">Car Lease Calculator</h1>
        <p className="text-gray-700 mb-8">Find the perfect car lease for your needs!</p>
        <Link to="/quiz">
          <button className="bg-blue-600 text-white px-8 py-3 rounded-lg font-semibold hover:bg-blue-700">
            Start Lease Quiz
          </button>
        </Link>
      </div>
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/quiz" element={<CarLeaseQuiz />} />
        <Route path="/results" element={<CarLeaseResults />} />
      </Routes>
    </div>
  );
}

export default App;
